import React from "react";

const Profile = () => (
  <div className="content">
    <h2> My Profile</h2>
    <p>Name: Student User</p>
    <p>University: Vignan University</p>
    <p>Email: student@vignan.ac.in</p>
  </div>
);

export default Profile;
